  input: TEXT,SA11A1,SA11A1.65328,"On 10/13/06 we received a contribution from James
    Ackerman in the amount of $24,000 which was deposited into our federal account.  Ten
    thousand dollars was reattributed to James Ackerman's wife, Lois, whose name was
    also on the check.  Four thousand dollars was transferred to our non-federal account,
    which can accept unlimited contributions from individuals, on 10/13/06.  A letter
    was sent to James & Lois Ackerman advising them of how their contribution was
    split and to offer them a chance for a refund.  According to AO 2001-17, the Commission
    has deemed it sufficient to deposit checks that exceed the donor's federal limits
    into our federal account and then to make a transfer to the non-federal account
    for the portion that is over the federal limit.  Therefore, year to date aggregate
    totals reported by James Ackerman on our report is a reflection of the federal
    portion of the donor's contribution to date."
